import axios from 'axios';

const AxiosRequest =  axios.create({
    baseURL:"http://127.0.0.1:8000/",
    timeout:5000,
    headers:{
        "Content-Type":"application/json",
        accept:"application/json",
    }
})

export default AxiosRequest;
